import React from 'react';
import { Card, Container,Row,Col} from "react-bootstrap";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import {faClock } from "@fortawesome/free-regular-svg-icons";
import { library } from '@fortawesome/fontawesome-svg-core'
import './CallNow.css'
function CallNow() {
        //This line explains how to document and run social media logos using fontawesome
  library.add( faClock); 
    return(

        <div>
         <br/>
         <br/>
<Container>
  <Row>
    <Col><img src="1.png" alt="logo"/></Col>
    <Col><img src="2.png" alt="logo"/></Col>
  </Row>
  </Container>
  <br/>
  <br/>
  <Card className="callcard">
  <Card.Body>
  <Container><i class="far fa-clock"></i>
  <Row>
    <Col><FontAwesomeIcon icon={['far','faclock']}/></Col>
    <Col>2 of 3</Col>
    <Col>3 of 3</Col>
  </Row>
</Container>
  </Card.Body>
</Card>
        </div>
    );
    
}
export default CallNow;
